def calculate_max_winning_probability(X, Y, N, W, P1, P2):
    P1 *= 100.0
    P2 /= 100.0
    scores = [[0] * (W + 1) for i in range(N + 1)]
    for i in range(0, N + 1):
        scores[i][0] = 1
    for i in range(1, N + 1):
        for j in range(1, W + 1):
            scores[i][j] = max(scores[i - 1][max(j - X, 0)] * P1 + scores[i - 1][max(j, 0)] * (1 - P1), scores[i - 1][max(j - Y, 0)] * P2 + scores[i - 1][max(j, 0)] * (1 - P2))
    return round(scores[N][W] * 100, 6)

